import logo from "./logo.svg";
import React from "react";
import "./App.css";

const App = () => {
  const todoList = [
    "Test React tool",
    "Write about Ant Design",
    "Finalize presentation",
    "Book flight to VN",
  ];
  return (
    <div>
      <div style={{ display: "flex", flexDirection: "row" }}>
        <input />
        <button type="button">Add</button>
      </div>
      {todoList.map((list) => (
        <div style={{ display: "flex", flexDirection: "row" }}>
          <input type="checkbox" value={list}></input>
          <div>{list}</div>
        </div>
      ))}
    </div>
  );
};

export default App;
